  false,\n\t\"url\": null,\n\t\"notes\": \"The Modoc, Shasta-Trinity, and Klamath
  national forests (US Forest Service), Tule Lake National Wildlife Refuge (US Fish
  and Wildlife Service), and Lava Beds National Monument (National Park Service) have
  proposed to designate approximately 121 miles of existing public roads in the Medicine
  Lake Highlands and McCloud Ranger District area of Siskiyou, Shasta, and Modoc counties,
  northern California, as the Modoc Volcanic Scenic Byway. These roads are on land
  administered by these  agencies.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
